import React from "react";
import image1 from "../src/images/music1.png";
import image2 from "../src/images/music2.png";
import image3 from "../src/images/music3.png";
import image4 from "../src/images/music4.png";
import image5 from "../src/images/music5.png";
import image6 from "../src/images/music6.png";
import image7 from "../src/images/music7.png";
import image8 from "../src/images/music8.png";
import image9 from "../src/images/music9.png";
import image10 from "../src/images/music10.png";
import image11 from "../src/images/music11.png";
import image12 from "../src/images/music12.png";

function MusicList() {
  return (
    <div>
      <h1>myMusic</h1>
      <img src={image1} />
    </div>
  );
}

export default MusicList;
